import * as React from "react";
import { Redirect } from 'react-router-dom';
import { useQuery, useMutation, useLazyQuery, useApolloClient } from "@apollo/react-hooks";
import { longStackSupport } from "q";
// Style
import './HeaderComp.styl';
// Icons
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { 
    faAnchor,
    faBell,
    faUserCog,
    faBuilding,
    faUserLock 
} from '@fortawesome/free-solid-svg-icons'
//
// Function
//

const HeaderComp: React.FunctionComponent<{}> = () => {
    // Set States
    const [redirectIndex, setRedirectIndex] = React.useState(false);

    //
    // Logout
    //

    const logout = () => {
        // Reset Cache
        const client = useApolloClient();
        client.writeData({ data: { isLoggedIn:false }});
        // Remove Local Storage
        window.localStorage.removeItem("user");
        window.localStorage.removeItem("token");
        // Redirect
        setRedirectIndex(true);
    }

    // Return
    return (
        <>   
        {redirectIndex ? <Redirect to="/" /> : null }
        <div className="header">

            <div className="header-logo">
                <FontAwesomeIcon icon={faAnchor} />
            </div>

            {/** Menu */}
            <div className="header-menu">
                <div className="header-user">
                    <div className="user-avatar"></div>
                    <div className="user-name">Lee Marshall</div>
                    <div className="user-email">lee@seedeck.com</div>
                </div>
                <div className="menu-list">
                    <div className="list-button">
                        Notifications 
                        <div className="button-icon">
                            <FontAwesomeIcon icon={faBell} />
                        </div>
                    </div>
                    <div className="list-button">
                        Account Settings 
                        <div className="button-icon">
                            <FontAwesomeIcon icon={faUserCog} />
                        </div>
                    </div>
                    <div className="list-button">
                        Company Settings 
                        <div className="button-icon">
                            <FontAwesomeIcon icon={faBuilding} />
                        </div>
                    </div>
                    <div  onClick={() => logout()} className="list-button">
                        Logout <div className="button-icon"></div>
                        <div className="button-icon">
                            <FontAwesomeIcon icon={faUserLock}/>
                        </div>
                    </div>
                </div>
            </div>   

            {/** Panel #1 */}

            {/** Panel #2 */}


        </div>



        </>
    );
};

export default HeaderComp
